/** Functions ----------------------------------------------------------------*/
/**
 * @brief	Returns the address for the wanted character
 * @param	Character: The character to get
 * @param	Font: Pointer to the font to use
 * @retval	The address for that character or 0 if it's invalid
 */
uint32_t FONTS_GetAddressForCharacterWithFont(char Character, FONT* Font)
{
	if (Character >= Font->firstValidCharacter && Character <= Font->lastValidCharacter)
	{
		/* The address is the start of the data table plus the total number of pixels before this character */
		return (uint32_t)Font->DataTable + Font->Height * Font->OffsetTable[Character - Font->firstValidCharacter];
	}
	else
		return 0;
}

/**
 * @brief	Returns the width of the wanted character
 * @param	Character: The character to get the width for
 * @param	Font: Pointer to the font to use
 * @retval	The width for that character or 0 if it's invalid
 */
uint8_t FONTS_GetWidthForCharacter(char Character, FONT* Font)
{
	if (Character >= Font->firstValidCharacter && Character <= Font->lastValidCharacter)
	{
		return Font->WidthTable[Character - Font->firstValidCharacter];
	}
	else if (Character == ' ')
	{
		return Font->SpaceWidth;
	}
	else
		return 0;
}

/**
 * @brief	Returns the offset of the wanted character
 * @param	Character: The character to get the offset for
 * @param	Font: Pointer to the font to use
 * @retval	The width for that character or 0 if it's invalid
 */
uint8_t FONTS_GetOffsetForCharacter(char Character, FONT* Font)
{
	if (Character >= Font->firstValidCharacter && Character <= Font->lastValidCharacter)
	{
		return Font->OffsetTable[Character - Font->firstValidCharacter];
	}
	else
		return 0;
}

/**
 * @brief	Returns the width of the wanted character
 * @param	Address: Pointer to where the address should be saved
 * @param	Width: Pointer to where the width should be saved
 * @param	Character: The character to get the information for
 * @param	Font: Pointer to the font to use
 * @retval	None, but if the character does not exist in the font
 * 			table it will return a "." (dot) instead
 */
void FONTS_GetAddressAndWidthForCharacter(uint32_t* Address, uint8_t* Width, char Character, FONT* Font)
{
	/* Check if the character exist in the font table */
	if (Character >= Font->firstValidCharacter && Character <= Font->lastValidCharacter)
	{
		uint32_t index = Character - Font->firstValidCharacter;
		*Address = (uint32_t)Font->DataTable + Font->Height * Font->OffsetTable[index];
		*Width = Font->WidthTable[index];
	}
	/* Otherwise just send back a character to show it's not valid, "." (dot) in this case */
	else
	{
		uint32_t index = '.' - Font->firstValidCharacter;
		*Address = (uint32_t)Font->DataTable + Font->Height * Font->OffsetTable[index];
		*Width = Font->WidthTable[index];
	}
}

/**
 * @brief	Returns the width of the wanted character
 * @param	String: Pointer to a string to check
 * @param	Font: Pointer to the font to use
 * @retval
 */
uint32_t FONTS_GetTotalWidthForString(char* String, FONT* Font)
{
	uint32_t widthSum = 0;

	/* Go through all the characters in the string */
	while (*String != 0)
	{
		if (*String != ' ')
			widthSum += FONTS_GetWidthForCharacter(*String, Font);
		else
			widthSum += Font->SpaceWidth;

		/* Point on the next character */
		String++;
	}

	return widthSum;
}
